import fetch  from 'isomorphic-fetch';

export default async (req, res) => {
    try {
        console.log(req)
        const res1 = await fetch("https://api.mercadolibre.com/sites/MLA/search?q=" + req.search);
        const json = await res1.json();
    } catch (error) {
        res.status(500);
    }
   
    
  res.status(200).json(json)
}
